import React from "react";

const Input = ({ type, placeholder = "", name }) => {
  return (
    <div class="field">
      <label className="label">{name}</label>
      <div class="control">
        <input className="input" type={type} placeholder={placeholder} />
      </div>
    </div>
  );
};

export default Input;
